import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="flex  flex-col items-center justify-center h-screen">
      <h1 className="text-4xl">Welcome To Coding Session 2</h1>
      <ul className='text-clip'>
        <li>React.js</li>
        <li>Tailwind.css</li>
        <li>Atomic Design</li>
        <li>Deployement using vercel</li>
      </ul>
    </div>
  );
}

export default App;
